import react,{component} from 'react';
import './App.css'
import Footer from './components/Footer';
import Header from './components/Header'
import List from './components/List'
function App() {
  return (
    <div className='todo-container'>
      <div className='todo-wrap'>
        <Header/>
       <List/>
       <Footer/>
      </div>
    </div>
  );
}

export default App;
